import { Button, Form, FormGroup } from 'reactstrap';
import React, { Component } from 'react';
import { Link, Redirect} from 'react-router-dom';
import './AdminManager.css';
import logo from './logo.png';
class AdminManager extends Component {
    constructor(props){
        super(props);
        const token = localStorage.getItem("token");

        let loggedIn = true
        if(token == null){
            loggedIn = false
        }
        this.state = {
            loggedIn
        }
    }

    logout(e){
        e.preventDefault();
        localStorage.removeItem('token');
    }


    render() {
        if(this.state.loggedIn ===false){
            return <Redirect to="/"/>
        }

        return (
            <div>
                <div>
                    <form className="logout" onSubmit={this.logout}>
                        <Link to="/">Logout</Link>
                    </form>
                </div>
                <div>
                    <img src={logo} alt=""/>
                    <h1 style={{color:'blue'}}>ADMINISTRATOR</h1>
                </div>

                <div className="bt">
                    <Form style={{width:'500px', marginRight:'auto', marginLeft:'auto'}}>
                        <FormGroup>
                            <Button style={{padding:'15px 10px 15px'}} color="primary" size="lg" block>Company Register</Button>
                        </FormGroup>
                        <FormGroup>
                            <Button style={{padding:'15px 10px 15px'}} color="primary" size="lg" block>Company List</Button>
                        </FormGroup>
                    </Form>
                </div>
            </div>    
        );
    }
}

export default AdminManager;
